import math, ast; is_prime = lambda n: n > 1 and all(n % i for i in range(2, int(math.sqrt(n)) + 1)); find_primes = lambda: open("primes.txt", "w").write(", ".join(map(str, [n for n in range(2, 100) if is_prime(n)]))); fibonacci = lambda n, m={0: 0, 1: 1}: m[n] if n in m else m.setdefault(n, fibonacci(n-1, m) + fibonacci(n-2, m)); __name__ == "__main__" and (find_primes(), print("Calculation result:", ast.literal_eval("2 + 3")), [print(f"Fibonacci of {x} is {fibonacci(x)}") for x in range(1, 10)])